function App() {
  const contacts=[
    {
      id:1,
      name:"Santhosh",
      email:"santhosh@gmail.com",
      phone:6361748785,
      address:"Ashok nagara camp"
    },
    {
      id:2,
      name:"Kumar",
      email:"kumara@gmail.com",
      phone:9972619889,
      address:"Nalkudre"
    },
    {
      id:3,
      name:"Googly",
      email:"googly@gmail.com",
      phone:8989898989,
      address:"Mayakonda"
    }
  ];
  return (
    <div className="ui container">
      <Header/>
      <AddContact/>
      <ContactList contacts={contacts}/>
    </div>
  );
}

export default App;
